import React, { Children } from "react";
import Footer from "../components/Footer/Footer";
import NavBar from "../components/NavBar/NavBar";

const main = ({ Children }) => {
  return (
    <>
      <NavBar />
      <div>{Children}</div>
      <Footer />
    </>
  );
};

export default main;
